function detailDatiDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Dati-detail').modal('show');

				$('#Detail-Dati-Active').prop('checked', data.active);
				$('#Detail-Dati-IdParent').val(data.idParent);
				$('#Detail-Dati-KodeDati').val(data.kodeDati);
				$('#Detail-Dati-NamaDati').val(data.namaDati);
				$('#Detail-Dati-Tipe').val(data.tipe);

}
